    accessor: 'bikenumber'
},
{
    Header: 'Season',
    accessor: 'distributedyear'
}];

var data = this.props.data;




class BikeTable extends Component {

    
  
    render() {    

      
       console.log(data)
    

        return(
                
       <div>

           <ReactTable
            data = {data.projectname}
            columns={columns}
            />

       </div>
        
            


        )
    }


}

export default graphql(getProjectsQuery)(BikeTable);
